import React, { Component } from 'react'

class Visit extends Component {
	// This will loop through the records adding them to the eventually outputted output array
	getRecords = () => {
		let records = this.props.visitRecord.records;
		records.sort((a,b)=>{
			if(a==b){
				return 0;
			}else{
				return a.license_number-b.license_number
			}
		})
		let output = [];
		this.props.visitRecord.records.forEach((record,index)=>{
			if(record.type==='visit'){
				output.push(<div key={'visit'+index} className="activity visit"><span className={'license-number'}>{record.license_number} </span>{record.activity}</div>)
			}else{
				output.push(<div key={'violation'+index} className="activity violation"><span className={'license-number'}>{record.license_number} </span><span className={'wac-code'}><a href={'http://apps.leg.wa.gov/wac/default.aspx?cite='+record.wac_code.replace(/\(.+\)/,'')} target="_blank" rel="noopener noreferrer">{record.wac_code}</a></span>{record.violation_type}<i>{record.penalty_type}</i></div>)
			}
		})
		output.sort();
		return output;
	}

	render(){
		// The output, plus were not gonna show the date over and over
		let output = [];
		let hasDated = false;

		// Loop through all the reocrds, each will get it's own table row
		this.props.visitRecord.records.forEach((record,index)=>{

			// Prepare the date
			let displayDate = (hasDated?'':this.props.visitRecord.date);
			hasDated = true;

			// Prepare the license, and wrap it in a td if were going to display it
			let displayLicense = null;
			if(this.props.showLic){
				console.log('true or some shit')
				displayLicense = (<td>{displayLicense}</td>)
			}

			// Prepare the output of the details line, pretty different if it's a visit or a violation
			let displayDetail = record.activity
			if(record.type==='violation'){
console.log('---------->>')
				displayDetail = <div key={'violation'+index} className="activity violation"><span className={'wac-code'}><a href={'http://apps.leg.wa.gov/wac/default.aspx?cite='+record.wac_code.replace(/\(.+\)/,'')} target="_blank" rel="noopener noreferrer">{record.wac_code}</a></span>{record.violation_type}<i>{record.penalty_type}</i></div>
			}
console.log(record.type)
			output.push(<tr key={this.props.visitRecord.index+'-'+index}>
				<td className={'date'}>{displayDate}</td>
				{displayLicense}
				<td>{displayDetail}</td>
			</tr>)
			console.log('renderer',record,index)

		});

		return output

		console.log(' --- ')



